function a (target : string , xml: XMLHttpRequest)
{
  var doc = document.getElementById(target);

  if(doc != null)
  {
    doc.innerHTML = xml.responseText;
  }
    
  return doc;
}

export function OpenPage(x: any,y: any){
    var indice = x
    var target = y

    //'../Formularios/Teste'
    var CaminhoForm = '../Formularios/' + indice
        
    var doc = document.getElementById(target);

    var xml = new XMLHttpRequest()
  
    if(doc != null)
    {
      doc.innerHTML = indice
    }
        
    xml.onreadystatechange = a(target, xml);

    xml.open('GET', indice, true)

    xml.send()
}
